package scratch;

import java.util.*;

public class p1647_Minimum_Deletions_to_Make_Character_Frequencies_Unique {
    public static void main(String[] args) {
        p1647_Minimum_Deletions_to_Make_Character_Frequencies_Unique p = new p1647_Minimum_Deletions_to_Make_Character_Frequencies_Unique();
        // String s  = "aab";
        // String s  = "aaabbbcc";
        // String s  = "ceabaacb";
        // String s = "bbcebab";
        String s = "";
        System.out.println(p.minDeletions(s));

    }

    public int minDeletions(String s) {
        Map<Character, Integer> charCount = new HashMap<>();
        for(int i = 0; i < s.length(); i++) {
            char ch  = s.charAt(i);
            charCount.put(ch, charCount.getOrDefault(ch,  0) + 1);
        }

        int res = 0;
        List<Integer> counts = new ArrayList<>();
        counts.addAll(charCount.values());
        Collections.sort(counts);
        System.out.println(counts);

        Set<Integer> occupied = new HashSet<>();
        occupied.add(counts.get(0));
        for(int i = 1; i < counts.size(); i++) {
            if (counts.get(i).equals(counts.get(i-1))) {
                int d = 1;
                while(counts.get(i) - d > 0) {
                    if (!occupied.contains(counts.get(i) - d)) {
                        occupied.add(counts.get(i) - d);
                        break;
                    } else {
                        d++;
                    }
                }
                res += d;
            } else {
                occupied.add(counts.get(i));
            }
        }
        return res;
    }


}
